For method 1, here are my thoughts:
```
fun main() {


    /// when user click flutter pub get button

    val builder = ProcessBuilder(
        "cmd", "/C",
        "flutter pub get"
    )

    /// read Proxy setting form Idea proxy settings,and set with runtime
    builder.environment()["http_proxy"] = "http://127.0.0.1:7890"
    builder.environment()["https_proxy"] = "http://127.0.0.1:7890"

    /// the flutter pub will run with proxy
    println(builder.start().inputStream.readAllBytes().decodeToString())

}
```

